import React, { Component } from 'react';
import { Collapse, Form, Button, Tabs, Layout, Input, Row, Col, DatePicker, Radio, Card, Select, Upload, message, Icon } from 'antd';
import moment from 'moment';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { createWorkingHourTimeSheet } from "../../redux/actions/CreateNewRequest";


class timesheet extends Component {

    constructor(props) {
        super(props);
        this.state = {

            workinghours: {
                "monday": {
                    day: 'monday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                },
                "tuesday": {
                    day: 'tuesday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                },
                "wednesday": {
                    day: 'wednesday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                },
                "thursday": {
                    day: 'thursday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                }, "friday": {
                    day: 'friday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                }, "saturday": {
                    day: 'saturday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                },
                "sunday": {
                    day: 'sunday',
                    workHours: 'Test',
                    timeOffHour: 'Test',
                    date: 'Test',
                    billableHours: 'Test',
                    totalHour: 'Test',
                    notes: 'Test'

                },

            }
            ,

            Workingdetails: {
                totalWorkHours: 'Test',
                totalWeekBillableHours: 'Test',
                totalWeekTimeoffHours: 'Test',
                timeOff: 'Test',
                noOfShift: 'Test',
                total: 'Test',
                totalBill: 'Test'
            }

        };
        // this.handlenum1Change = this.handlenum1Change.bind(this);
        this.handlenum2Change = this.handlenum2Change.bind(this);
    }

    // onDropdownChange = (e, i) => {
    //     console.log("DDL" + e);
    //     let reqDetails = Object.assign({}, this.state.reqDetails);
    //     reqDetails.ddlJob = e;
    //     return this.setState({ reqDetails });
    // }

    handlenum1Change = (evt) => {
        let workinghours = Object.assign({}, this.state.workinghours);

        let day = workinghours[evt.target.name]
        day.workHours = Number(evt.target.value);
        console.log("ADS" + day.workHours);
        day.totalHour = Number(evt.target.value);
        return this.setState({ workinghours });
    }

    handlenum2Change(evt) {
        console.log(typeof evt.target.value);
        this.setState({ timeOff: Number(evt.target.value) });
        let y = this.state.noOfShift + Number(evt.target.value)
        this.setState({ total: y })


    }


    onSubmit = () => {
        let data = {};
        data.workinghours = this.state.workinghours;
        data.Workingdetails = this.state.Workingdetails;
        // data.reqId = this.state.reqDetails.reqId;
        this.props.dispatch(createWorkingHourTimeSheet(data));
        console.log("Save click");
    };

    // getDay() {
    //   //  let dt = moment(this.props.timesheet.timesheet.reqDetails.selectWeek);
    //     let selectedDate = dt.startOf('week').format("MM/DD/YYYY");
